        </div>
        <div className="col">
            <div class="footer-copyright text-center text-center py-3 ">Â© 2020 Copyright:
              <a href="https://mdbootstrap.com/"> MDBootstrap.com</a>
            </div>
        </div>
      </div>
    </footer>
  );
}
